    false,nt"url": null,nt"notes": "This annual narrative report for Tamarac
    National Wildlife Refuge summarizes Refuge activities during the 1993 calendar year.
     The report begins with a summary of the yearu2019s highlights and climatic conditions.
     Land acquisition is also covered.  The report includes a planning section which
    discusses the management plan, research, and investigations.  Refuge administration
    is outlined; information about personnel, youth programs, manpower programs, volunteer
    programs, funding, safety, and technical assistance is given.  Habitat management
    is also covered.  Subjects include wetlands, forests, croplands, grasslands, fire
    management, pest control, Farmers Home Administration Conservation Easements, and
    private lands.  The wildlife section of the report discusses wildlife diversity,
    endangered species, waterfowl, marsh birds, waterbirds, shorebirds, raptors, game
    mammals, fisheries resources, wildlife propagation and stocking, scientific collections,
    animal control, marking, and banding.  The public uses of the Refuge described in
    this report include outdoor classrooms, interpretive exhibits, hunting, fishing,
    trapping, wildlife observation, law enforcement, and cooperating associations.  The
    equipment and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, equipment utilization/replacement, communications
    systems, computer systems, and energy conservation.  Cooperative programs, economic
    uses of the Refuge, and items of interest are provided at the end; Refuge brochures
    are attached.",nt"license_title": "License Not Specified",nt"extras":
